import React from 'react';
import { PlusOutlined } from '@ant-design/icons';
const Room = () => {

    return (
        <div>

        <div className="messageTitle" style={{borderBottom: "solid thin #EFEEF5"}}>
            <div style={{maxWidth: "600px", margin: "0 auto", display:"flex", border: "solid thin #EFEEF5"}}>
                <div style={{maxWidth: "400px", justifyContent: "flex-start"}}>
                <h2>&nbsp;&nbsp;Messages</h2>
                </div>
                <div style={{justifyContent: "flex-end"}}>
                <PlusOutlined />
                </div>
            </div>
        </div>

        <div style={{clear:"both"}}>
        <h1>Send a message, get a message</h1>
        <p>Direct Messages are private conversations between you and other people on Twitter. Share Tweets, media, and more!</p>
        </div>

        </div>
    );
}

export default Room;
